Information
------------------------------

Tallest Towers
Rising 610 metres tall, the Canton Tower is the tallest television tower in the world. It's required great leaps in technology to be built. In this film we explore the key historic towers that made these engineering breakthroughs. Using stunning CGI animation, we reveal the incredible stories behind the Washington Monument, the Eiffel Tower, Canada's CN Tower and the record-breaking Canton Tower, and the innovations that have enabled towers to grow in size. Four ingenious leaps forward that enabled towers to evolve

